import React from 'react';
import MainPage from '../main-page/main-page';
import {booksPropTypes} from '../../common/prop-types.js';
import {AppRoute} from '../../common/const';
import {BrowserRouter, Routes, Route, useParams} from 'react-router-dom';
import NotFoundScreen from '../not-found-screen/not-found-screen';
import SignIn from '../SignIn/SignIn';
import BookPage from '../book-page/book-page';
import Reader from '../reader/reader';
import browserHistory from "../../browser-history";

const App = (props) => {
  const {reviewsData, booksData, readersData} = props;

  return (
    <BrowserRouter history={browserHistory}>
      <Routes>
        <Route exact path={AppRoute.MAIN} element={<MainPage books={booksData} />}/>
        <Route exact path={AppRoute.LOGIN} element={<SignIn />} />
        <Route exact path={AppRoute.BOOKPAGE} element={ <BookPage reviews={reviewsData} books={booksData} />} />
        <Route exact path={AppRoute.READER} element={ <Reader readers={readersData} books={booksData}/>} />
        <Route exact path={AppRoute.ERROR} element={<NotFoundScreen />} />
        <Route path="*" element={<NotFoundScreen />} />
      </Routes>
    </BrowserRouter>
  );
};

App.propTypes = {
	booksData: booksPropTypes
};

 export default App;
